import React, { Component } from 'react';
import { Switch, Route } from 'react-router-dom';
import DataList from './DataList';
/**
 * route: Object {
 *  initialRequest: {
 *    url, dataListID, defaultParams
 *  },
 *  allowedRoleTypes: [ guests,  ],
 *  path,
 *  exact,
 *  strict
 * }
 */
class Routes extends Component {
  render() {
    const {
      routes, roleTypes, authorized, unathorized
    } = this.props;
    return (
      <Switch>
        {routes.map(
          (route) => (
            <Route {...route} />
          )
        )}
      </Switch>
    );
  }
}

export default Routes;
